import React from 'react';
import { Outlet, Link } from "react-router-dom";
import { useNavigate } from 'react-router-dom';
import WelcomeUserSpan from '../components/atoms/spans/WelcomeUserSpan';
import LogoutButton from '../components/atoms/buttons/LogoutButton';
import LoginButton from '../components/atoms/buttons/LoginButton';
import '../styles/index.scss';


const Layout = ({ name, setName }: { name: string, setName: (name: string) => void }) => {

  const navigate = useNavigate();

  const logout = async () => {
    const response = await fetch('http://localhost:8000/api/logout', {
      method: 'POST',
      headers: {'Content-Type': 'application/json'},
      credentials: 'include',
    });
    if(response.ok){
      setName('');
      return navigate('/');
    }
    else{
      console.log('Logout problem')
    }
  }

  let authorization_div;

  if(name===''){
    authorization_div = (
      <div>
        <LoginButton />
      </div>
    )
  }
  else {
    authorization_div = (
      <div className='authorization-div-wrapper'>
        <WelcomeUserSpan name={name} />
        <LogoutButton Click={logout} />
      </div>
    )
  }

  return (
    <>
      <div className='layout-div-wrapper'>
        <div>
          <Link to='/'>Logo</Link>
        </div>
        <nav>
          <ul>
            <li>
              <Link to="/" className='nav-link-wrapper'>Artyku≈Çy</Link>
            </li>
            <li>
              <Link to="/" className='nav-link-wrapper'>Informacje</Link>
            </li>
            <li>
              <Link to="/" className='nav-link-wrapper'>Diety</Link>
            </li>
            <li>
              <Link to="/" className='nav-link-wrapper'>Dziennik</Link>
            </li>
            <li>
              <Link to="/" className='nav-link-wrapper'>Kontakt</Link>
            </li>
          </ul>
        </nav>
        <div>
          {authorization_div} 
        </div>
      </div>
      <Outlet />
    </>
  )
};

export default Layout;
